import { Disclosure } from '@headlessui/react';
import { Bars3Icon, BellIcon, XMarkIcon } from '@heroicons/react/24/outline';
import { Link } from 'react-router-dom';
import React, { useState, useEffect } from 'react';
import axios from 'axios';


const navigation = [
  { name: 'Dashboard', href: '/dashboard', current: true },
]

function classNames(...classes) {
  return classes.filter(Boolean).join(' ')
}

export default function Dashboard() {

  const [isModalOpen, setIsModalOpen] = useState(false);

  const openModal = () => {
    setIsModalOpen(true);
  };

  const closeModal = () => {
    setIsModalOpen(false);
  };


  const [cartdata, setcartdata] = useState([]);
  const [data, setData] = useState();


  useEffect(() => {
    axios.get('http://localhost:5000/api/products').then(
      response => {
        setData(response.data);
      }
    ).catch(error => {
      console.error(error);
    })
  }, [])

  return (
    <>
      <Disclosure as="nav" className="bg-gray-800">

        {({ open }) => (
          <>
            <div className="mx-auto max-w-7xl px-2 sm:px-6 lg:px-8">
              <div className="relative flex h-16 items-center justify-between">
                <div className="absolute inset-y-0 left-0 flex items-center sm:hidden">
                  {/* Mobile menu button*/}
                  <Disclosure.Button className="relative inline-flex items-center justify-center rounded-md p-2 text-gray-400 hover:bg-gray-700 hover:text-white focus:outline-none focus:ring-2 focus:ring-inset focus:ring-white">
                    <span className="absolute -inset-0.5" />
                    <span className="sr-only">Open main menu</span>
                    {open ? (
                      <XMarkIcon className="block h-6 w-6" aria-hidden="true" />
                    ) : (
                      <Bars3Icon className="block h-6 w-6" aria-hidden="true" />
                    )}
                  </Disclosure.Button>
                </div>
                <div className="flex flex-1 items-center justify-center sm:items-stretch sm:justify-start">
                  <div className="flex flex-shrink-0 items-center">
                    <h1 className='text-white font-bold'>Ecommerce Admin</h1>
                  </div>
                  <div className="hidden sm:ml-6 sm:block">
                    <div className="flex space-x-4">
                      {navigation.map((item) => (
                        <a
                          key={item.name}
                          href={item.href}
                          className={classNames(
                            item.current ? 'bg-gray-900 text-white' : 'text-gray-300 hover:bg-gray-700 hover:text-white',
                            'rounded-md px-3 py-2 text-sm font-medium'
                          )}
                          aria-current={item.current ? 'page' : undefined}
                        >
                          {item.name}
                        </a>
                      ))}
                    </div>
                  </div>
                </div>
                <div className="absolute inset-y-0 right-0 flex items-center pr-2 sm:static sm:inset-auto sm:ml-6 sm:pr-0">
                  <button
                    type="button"
                    className="py-3 px-4 inline-flex items-center gap-x-2 text-sm font-semibold rounded-lg border border-transparent bg-blue-600 text-white hover:bg-blue-700 disabled:opacity-50 disabled:pointer-events-none dark:focus:outline-none dark:focus:ring-1 dark:focus:ring-gray-600"
                    onClick={openModal}
                  >
                    Cart
                  </button>
                  <Link to='/signin' className='text-white font-medium ml-4' >Sign out</Link>
                </div>
              </div>
            </div>

            <Disclosure.Panel className="sm:hidden">
              <div className="space-y-1 px-2 pb-3 pt-2">
                {navigation.map((item) => (
                  <Disclosure.Button
                    key={item.name}
                    as="a"
                    href={item.href}
                    className={classNames(
                      item.current ? 'bg-gray-900 text-white' : 'text-gray-300 hover:bg-gray-700 hover:text-white',
                      'block rounded-md px-3 py-2 text-base font-medium'
                    )}
                    aria-current={item.current ? 'page' : undefined}
                  >
                    {item.name}
                  </Disclosure.Button>
                ))}
              </div>
            </Disclosure.Panel>
          </>
        )}
      </Disclosure>

      <div>
        {
          <div className='products grid grid-cols-3'>
            {data?.map((data) =>

              <div className='border-2 flex flex-col justify-between h-100' key={data.id}>
                <img className='img flex-grow'
                  src={data.image}
                  alt="img" width="200px" height="200px" />

                <div className='flex justify-between p-2'>
                  <div>
                    <h1>{data.name}</h1>
                    <p>{data.description}</p>
                    <p>{data.price}</p>
                  </div>
                  <button className='bg-sky-600 p-2 rounded-lg font-medium h-fit text-white' onClick={() => {
                    alert('Item added successfully');
                    setcartdata([...cartdata, data]);
                    console.log(cartdata);
                  }}>Add to Cart</button>



                </div>
              </div>



            )
            }
          </div>
        }
      </div>



      {/* Modal */}
      {isModalOpen && (
        <div className="fixed top-0 left-0 w-full h-full bg-gray-900 bg-opacity-50 z-50 flex justify-center items-center">
          <div className="bg-white p-6 rounded-lg shadow-lg">
            <div className="flex justify-between items-center mb-4">
              <h3 className="text-lg font-semibold text-gray-800">Items In Cart</h3>
              <button
                className="text-gray-600 hover:text-gray-800 focus:outline-none"
                onClick={closeModal}
              >
                <svg
                  className="w-6 h-6"
                  fill="none"
                  stroke="currentColor"
                  viewBox="0 0 24 24"
                  xmlns="http://www.w3.org/2000/svg"
                >
                  <path
                    strokeLinecap="round"
                    strokeLinejoin="round"
                    strokeWidth="2"
                    d="M6 18L18 6M6 6l12 12"
                  ></path>
                </svg>
              </button>
            </div>
            <div className="p-4 flex  gap-3">
              {
                cartdata.map((v)=>{
                  return(
                  <div className='border-2 p-2 border-blue-500 flex flex-col'>
                    <p>{v.name}</p>
                    <p>{v.description}</p>
                    <img src={v.image} width='300px' height='300px' className='flex-grow object-cover'/>
                    <p>{v.price}</p>
                    </div>
                  )
                })
              }





            </div>
            <div className="flex justify-end">
              <button
                className="py-2 px-3 inline-flex items-center gap-x-2 text-sm font-semibold rounded-lg border border-transparent bg-blue-600 text-white hover:bg-blue-700"
              >
                Checkout
              </button>
            </div>
          </div>
        </div>
      )}

    </>

  )
}
